import React, { Component } from 'react';
import { users, addUser } from '../../model/store';
import io from 'socket.io-client';

class App extends Component {

  style = {
    textAlign: 'center'
  }

  nav = () => {

  }

  state = {
    text: 'initial text'
  }
  pressKey = (e) => {
    this.setState(...this.state, this.state.text)
  }
  render() {
    return (
      <div style={this.style}>
        <h1>App component</h1>
        {users.map((user, i) =>
          <div key={i}>
            <h1>{this.state.text}</h1>
            <span>{user.name}</span>
            <span>{user.lastname}</span>
            <input type="text" onKeyUp={(e) => this.pressKey(e)} />
          </div>)
        }
        <button onClick={() => addUser({ name: 'fromApp', lastname: 'lastnameApp' })}>add</button>
        <button onClick={() => this.props.history.push("2")}>route</button>
      </div>
    );
  }
}

export default App;
